import React from 'react';

const joinSession = (props) => {
    return (
        <div className="JoinSession">
            <h1>Join Session</h1>
            <input></input>
            <input type="text" defaultValue="Room Code"></input>
            <button>Let's Play!</button>
        </div>
    )
}

export default joinSession;
